import React from 'react';
import { useNavigate } from 'react-router-dom';

import leftLandingBG from '../assets/leftLandingBG.png'
import rightLandingBG from '../assets/rightLandingBG.png'

const styles = {
    container: {
        display: 'flex',
    },
    left: {
        width: '50%',
        backgroundImage: `url(${leftLandingBG})`,
        cursor: 'pointer',
    },
    right: {
        width: '50%',
        backgroundImage: `url(${rightLandingBG})`,
        cursor: 'pointer',
    },
};

const LandingBG = () => {
    const history = useNavigate();

    const handleShopClick = () => {
        history.push('/shop');
    };

    const handleAboutClick = () => {
        history.push('/about');
    };

    return(
        <div style={styles.container}>
            <div style={styles.left} onClick={handleShopClick} />
            <div style={styles.right} onClick={handleAboutClick} />
        </div>
    );
}


export default LandingBG;
